import React from "react";
import GlobalStyle from "../theme/globalstyles";
import Login from "./Login";

export default function App() {
  return (
    <BrowserRouter>
      <GlobalStyle />
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
}
